import React, {useEffect, useState, useRef} from "react";

function SidaSammanlagdStats({patienter}) {
  const [currentValue, setCurrentValue] = useState(0);
  const previousValue = useRef(0);

  // Uppdatera currentValue varje gång patienter ändras
  useEffect(() => {
    setCurrentValue(patienter.length);
  }, [patienter]);

  // Uppdatera previousValue varje gång currentValue ändras
  useEffect(() => {
    previousValue.current = currentValue;
  }, [currentValue]);

  return (
    <>
      <div className="tittel">
        <h1>Statistik filtrerad</h1>
      </div>
      <p>Nuvarande värde: {currentValue}</p>
      <p>Föregående värde: {previousValue.current}</p>
    </>
  );
}

export default SidaSammanlagdStats;
